import Link from "next/link";

const Index = () => (
    <>
        <div>
            <h1>Ethereum Tools</h1>
            <Link href="/decode"></Link>
        </div>
        <style jsx global>{`
            body {
                font-family: sans-serif, helvetica;
            }
        `}</style>
    </>
  );

  export default Index;
